import React, { Component } from 'react';

export default class InputFind extends Component {
  render() {
    const { id, type, dataTest, label } = this.props;

    return (
      <label htmlFor={ id }>
        { label }
        <input id={ id } type={ type } data-testid={ dataTest } />
      </label>
    );
  }
}
